import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const Nav = styled.nav`
  background: ${props => props.theme.colors.bg_base_dark};
  width: 100%;
`;

const Menu = styled.menu`
  background: ${props => props.theme.colors.bg_base_dark};
  width: 100%;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: center;
  & a {
    color: white;
  }
`;

const Brand = styled.div`
  width: 500px;
  > img {
    width: 100%;
  }
`

const Item = styled.div`
  padding: 15px 5px;
  white-space: nowrap;
`

function Navbar() {
  return (
    <>
      <Nav>
        <Menu>
          <Brand>
            <Link href="/">
              <img src="/images/Logo.png" alt="my image" />
            </Link>
          </Brand>
          <Item>
            <Link href="/">
              <a>Home</a>
            </Link>
          </Item>
          <Item>
            <Link href="/about">
              <a>Skills</a>
            </Link>
          </Item>
          <Item>
            <Link href="/">
              <a>Posts</a>
            </Link>
          </Item>
          <div className="toggle"><a href="#"><i className="fas fa-bars"></i></a></div>
        </Menu>
      </Nav>
      {/* <Nav>
        <Brand>
          <img src="/images/Logo.png" alt="my image" />
        </Brand>

        <NavbarNav>
          <Link href="/">
            <a>Home</a>
          </Link>
          <Link href="/about">
            <a>About</a>
          </Link>
        </NavbarNav>
      </Nav> */}
    </>
  )
}

export default Navbar
